import '../App.css';
import React from "react";
import { Link, useLocation } from "react-router-dom";



function Nav() {
    const nowloc = useLocation();
    const path = nowloc.pathname;
    const nav = document.querySelector("#nav");
    const navElement = nav.querySelectorAll("Link");


    console.log(navElement.href);


    return (
        <header>
            <nav id="nav">
                <Link to="/" className="str">Home</Link>
                <Link to="/Alarm" className="str">Alarm</Link>
                <Link to="/Timer" className="str">Timer</Link>
                <Link to="/Checklist" className="str">CheckList</Link>
                <Link to="/Weather" className="str">Weather</Link>
            </nav>
        </header>
    )
}

export default Nav
